inline long int nearest_integer(double d)
{
    if (d < 0) return( -(long int)(-d + 0.5));
    return((long int)(d + 0.5));
}

void generate_ef_lattice(long int p, long int r1,
                         std::pair<long int, long int>& e2,
                         std::pair<long int, long int>& e1)
{
    /*
     * e1, e2 spans the lattice
     * find f1, f2 which are linear combinations of e1, e2, but are "smaller"
     * In general:
     * f1 = a e1 + b e2
     * f2 = c e1 + d e2
     * Let's look at
     * f1 = e2
     * f2 = e1 - k e2
     * f1.f2 = e1.e2 - k e2.e2
     * If k is set to e1.e2 / e2.e2 then f1.f2 = 0.
     * Since we're dealing with integers, choose k as close as possible to e1.e2 / e2.e2,
     * so f1.f2 is close to zero.
     * Repeat, and terminate when -1/2 < e1.e2 / e2.e2 < 1/2
     * i.e. -e2.e2 < 2 e1.e2 < e2.e2
     */
    e1.second = p;
    e1.first = 0L;
    e2.second = r1;
    e2.first = 1L;

    while (1)
    {
        double dx1 = e1.second;
        double dx2 = e2.second;
        double dy1 = e1.first;
        double dy2 = e2.first;
        double dot12 = dx1*dx2 + dy1*dy2;
        double dot22 = dx2*dx2 + dy2*dy2;
        double dquot = dot12/dot22;
        if (dquot > -0.500001 && dquot < 0.50001)
        {
            //std::cerr << "generate_ef_lattice: p = " << p << ", r1 = " << r1 << ", e1 = (" << e1.first << "," << e1.second << "), e2 = (" << e2.first << "," << e2.second << ")" << std::endl;
            return;
        }
        long int squot = nearest_integer(dquot);
        e1.first -= squot*e2.first;
        e1.second -= squot*e2.second;
        std::swap(e1, e2);
    }
}
/*
       A = a.a, B = b.b
       N = a.b
       r = | N / B | (nearest integer)
       tmp = b
       b = a - r b
       a = b
       T = A - 2r N + r^2 B
       A = B
       B = T
       new N is (a - rb).b = old N - r old B
*/
void generate_ef_lattice1(long int p, long int r1,
                          std::pair<long int, long int>& e2,
                          std::pair<long int, long int>& e1)
{
    e1.second = p;
    e1.first = 0L;
    e2.second = r1;
    e2.first = 1L;
    double dx1 = e1.second;
    double dx2 = e2.second;
    double dy1 = e1.first;
    double dy2 = e2.first;
    double A = dx1 * dx1 + dy1 * dy1;
    double B = dx2 * dx2 + dy2 * dy2;
    double N = dx1 * dx2 + dy1 * dy2;
    long int r = nearest_integer(N / B);

    while (1)
    {
        double T = r * B;
        T -= N;
        T -= N;
        T *= r;
        T += A;
        std::pair<long int, long int> tmp = e2;
        e2.first = e1.first - r * e2.first;
        e2.second = e1.second - r * e2.second;
        e1 = tmp;
        if (T >= B)
        {
            //std::cerr << "generate_ef_lattice1: p = " << p << ", r1 = " << r1 << ", e1 = (" << e1.first << "," << e1.second << "), e2 = (" << e2.first << "," << e2.second << ")" << std::endl;
            return;
        }

        N -= r * B;
        A = B;
        B = T;
        r = nearest_integer(N / B);
    }
}

// Lenstra's code for lattice reduction taken from s10ls.c
void generate_ef_lattice2(long int p, long int r1, std::pair<long int, long int>& e1, std::pair<long int, long int>& e2)
{
    long int x1 = p;
    long int y1 = 0L;
    long int x2 = r1;
    long int y2 = 1L;
    long int x3;
    long int y3;
    double s3;
    long int q;

    double s2 = x2 * (double) x2 + y2 * (double) y2;

    for (;;)
    {
        x3 = x1;
        y3 = y1;
        long int k = x3 / x2;
        x3 -= k * x2;
        y3 -= k * y2;

        s3 = x3 * (double) x3 + y3 * (double) y3;
        if (s3 >= s2) break;
        s2 = s3;
        x1 = x2;
        y1 = y2;
        x2 = x3;
        y2 = y3;
    }

    q = (long int) nearest_integer( (x2 * (double) x3 + y2 * (double) y3) / s2 );

    e1.second = x2;
    e1.first = y2;
    e2.second = x3 - x2 * q;
    e2.first = y3 - y2 * q;
    //std::cerr << "generate_ef_lattice2: p = " << p << ", r1 = " << r1 << ", e1 = (" << e1.first << "," << e1.second << "), e2 = (" << e2.first << "," << e2.second << ")" << std::endl;
}

void generate_ef_lattice3(long int p, long int r1, std::pair<long int, long int>& e2, std::pair<long int, long int>& e1)
{
    long int x1 = p;
    long int y1 = 0L;
    long int x2 = r1;
    long int y2 = 1L;
    long int x3;
    long int y3;

    double s2 = x2 * (double) x2 + y2 * (double) y2;

    while (1)
    {
        x3 = x1;
        y3 = y1;
        long int k = x3 / x2;
        x3 = x3 % x2;
        y3 -= k * y2;

        double s3 = x3 * (double) x3 + y3 * (double) y3;
        if (s3 >= s2) break;
        s2 = s3;
        x1 = x2;
        y1 = y2;
        x2 = x3;
        y2 = y3;
    }

    long int q = (long int) nearest_integer( (x2 * (double) x3 + y2 * (double) y3) / s2 );

    e1.second = x2;
    e1.first = y2;
    e2.second = x3 - x2 * q;
    e2.first = y3 - y2 * q;
}

std::pair<long int, long int> neg(const std::pair<long int, long int>& x)
{
    return std::pair<long int, long int>(-x.first, -x.second);
}

